INSERT INTO calls_calllog VALUES(1,'Query','Aim to map the maize seeds we are recommending to farmers at the ward level. This initiative will help ensure farmers plant maize varieties best suited to their areas, leading to improved yields.','IP','2024-12-02 06:33:44.384503','2024-12-03 06:03:00.866288',1,1,1,'Downloaded the Bayer Excel Sheet as shared by George. Mapping on going as we speak.','Maize','We should have such mapping data ready in digital format at all times so as to resolve such requests in the shortest time possible.');
INSERT INTO calls_calllog VALUES(2,'Query','H513','R','2024-12-02 08:45:16.942737','2024-12-03 06:01:25.708478',1,1,2,'To communicate once seed availability is confirmed.','Maize','Restock of H513 variety imminent.');
INSERT INTO calls_calllog VALUES(3,'Query','GLORIA F1 CABBAGE PRICE AND AVAILABILITY.','R','2024-12-02 12:18:19.401271','2024-12-03 06:00:19.590274',1,1,3,'Confirmed to client Peter that the seed is available and sent him to our Nakuru Branch for the seeds.','Others','To fast track on e-commerce implementation at KSC to enable clients like Peter purchase online from wherever they are.');
INSERT INTO calls_calllog VALUES(4,'Query','Requesting partnership with KSC','R','2024-12-02 12:59:40.137162','2024-12-03 05:59:13.436836',1,1,4,'Explained to the client the Modus operandi at KSC regarding growers'' partnerships.','Others','More stakeholder engagement to sensitize potential growers on the KSC growers program.');
INSERT INTO calls_calllog VALUES(5,'Query','Gloria F1 100g prices','R','2024-12-02 13:02:20.496052','2024-12-03 05:56:44.878966',1,1,5,'Read the prices for 50g since the 100g is out of stock.','Others','Restocking of Gloria F1 100g');
INSERT INTO calls_calllog VALUES(6,'Query','Spring Onion','R','2024-12-03 08:02:34.421258','2024-12-03 08:10:59.820878',1,1,6,'To communicate once seed is available.','Others','Spring onion has been out of stock for a while. I recommend we restock it soonest possible.');
INSERT INTO calls_calllog VALUES(7,'Query',replace(replace('Dairy farmer in njeed of pasture and fodder for dairy cows. \r\nHas tried various pasture crops from us before such as Boma Rhodes, Sudan grass, and bracharia. \r\n\r\nLooks to establish Lucern and Boma Rhodes','\r',char(13)),'\n',char(10)),'R','2024-12-03 08:09:46.429408','2024-12-03 08:09:46.429408',1,1,7,'Gave customer details on Boma Rhodes and Lucern, including pricing and planting tips.','Others','To followup with farmer and ensure crops established correctly.');
INSERT INTO calls_calllog VALUES(8,'Query',replace(replace('1. Which is the best variety - Maize\r\n2. What agronomically','\r',char(13)),'\n',char(10)),'R','2024-12-03 08:33:58.128413','2024-12-03 08:33:58.128413',1,1,8,replace(replace('1. Sort to know customer experience.\r\n2. Probed the customer further to discover the agronomical practices he has deployed in his farm now and before. \r\n\r\nDiscovered: \r\n1. Farmer doesn''t do crop rotation hence poor soil structure','\r',char(13)),'\n',char(10)),'Others','Advised farmer to do crop rotation once done with Maize harvest so as to improve his soil structure and nutrients, for better yield.');
INSERT INTO calls_calllog VALUES(9,'Query',replace(replace('Pesira organization: - deals with farmers. \r\n\r\nIntends to partner with us for farming purposes.','\r',char(13)),'\n',char(10)),'R','2024-12-03 11:26:54.506216','2024-12-03 11:26:54.506216',1,1,9,'Took clients contacts for further consultations, as well as directed her on our official channels of communication: sales@kenyaseed.co.ke','Others','Follow up required.');
INSERT INTO calls_calllog VALUES(10,'Query',replace(replace('Log book transfer: \r\n- Tractor Log book transfer','\r',char(13)),'\n',char(10)),'R','2024-12-03 11:53:06.839181','2024-12-03 11:53:06.839181',1,1,10,'Adviced farmer to visit HQ Legal Office','Others','Log book transfer queries to be directed to the legal office.');
